ðŸ“„ **CleanupWithProgress-ETA.ps1**

<#  CleanupWithProgress-ETA.ps1
    - Real-time progress + ETA for each step
    - status.json includes: percent, itemsDone, itemsTotal, ratePerSec, etaSec
    - Detailed console + file logs
    - Checkpoints + -Resume support
#>

[CmdletBinding()]
param(
  [switch]$Deep,
  [switch]$Dism,
  [switch]$Sfc,
  [switch]$Resume,
  [string]$WorkDir = "$env:ProgramData\CodexCleanup"
)

$ErrorActionPreference = 'Stop'
New-Item -ItemType Directory -Force -Path $WorkDir | Out-Null
$LogFile    = Join-Path $WorkDir "cleanup_$(Get-Date -Format 'yyyyMMdd_HHmmss').log"
$StatusPath = Join-Path $WorkDir "status.json"
$CkptPath   = Join-Path $WorkDir "checkpoint.json"

# default to all
if (-not ($Deep -or $Dism -or $Sfc)) { $Deep=$true; $Dism=$true; $Sfc=$true }

$steps = @()
if ($Deep) { $steps += 'DeepCleanup' }
if ($Dism) { $steps += 'DismRestoreHealth' }
if ($Sfc ) { $steps += 'SfcScan' }
$totalSteps = [double]$steps.Count

# resume
$completed = @()
if ($Resume -and (Test-Path $CkptPath)) {
  try { $completed = (Get-Content $CkptPath | ConvertFrom-Json).completed } catch {}
  if (-not $completed) { $completed = @() }
}
$sw = [System.Diagnostics.Stopwatch]::StartNew()

function Write-Log($msg) {
  $line = "[{0}] {1}" -f (Get-Date -Format 'yyyy-MM-dd HH:mm:ss'), $msg
  $line | Tee-Object -FilePath $LogFile -Append
}

function Save-Checkpoint {
  $ck = @{ completed = $completed }
  ($ck | ConvertTo-Json -Depth 3) | Set-Content -Path $CkptPath -Encoding UTF8
}

function Save-Status([string]$phase, [int]$stepIndex, [double]$percent, [string]$note,
                     [int]$itemsDone = $null, [int]$itemsTotal = $null,
                     [double]$ratePerSec = $null, [double]$etaSec = $null) {

  $obj = [ordered]@{
    phase       = $phase
    stepIndex   = $stepIndex
    stepTotal   = [int]$totalSteps
    percent     = [int][math]::Round($percent)
    note        = $note
    itemsDone   = $itemsDone
    itemsTotal  = $itemsTotal
    ratePerSec  = if ($ratePerSec) { [math]::Round($ratePerSec,2) } else { $null }
    etaSec      = if ($etaSec) { [int][math]::Ceiling($etaSec) } else { $null }
    elapsedSec  = [int]$sw.Elapsed.TotalSeconds
    timestamp   = (Get-Date).ToString('o')
    logFile     = $LogFile
    checkpoint  = $CkptPath
  }
  ($obj | ConvertTo-Json -Depth 4) | Set-Content -Path $StatusPath -Encoding UTF8
  Write-Progress -Activity "System Cleanup" -Status $note -PercentComplete $obj.percent
}

function PercentForStep([int]$idx, [double]$withinStep) {
  if ($totalSteps -le 0) { return 100.0 }
  $stepPortion = 100.0 / $totalSteps           # e.g., 33.33% per step (3 steps)
  return ($idx-1)*$stepPortion + ($withinStep * $stepPortion / 100.0)
}

function ETA($done, $total, $elapsedSec) {
  if ($done -le 0) { return $null }
  $rate = $done / [math]::Max($elapsedSec,1)
  $remaining = [math]::Max($total - $done, 0)
  return @{ eta = $remaining / $rate; rate = $rate }
}

# ----------- Step 1: DeepCleanup with live counts + ETA -----------
function Run-DeepCleanup([int]$idx) {
  $targets = @(
    "$env:TEMP",
    "$env:WINDIR\Temp",
    "$env:LOCALAPPDATA\Temp",
    "$env:LOCALAPPDATA\Microsoft\Windows\INetCache",
    "$env:LOCALAPPDATA\Microsoft\Windows\WebCache",
    "$env:ProgramData\Microsoft\Windows\WER"
  )
  Write-Log "DeepCleanup scanning..."
  $allFiles = @()
  foreach ($root in $targets) {
    if (Test-Path $root) {
      try {
        $allFiles += Get-ChildItem -LiteralPath $root -Recurse -Force -File -ErrorAction SilentlyContinue
      } catch {}
    }
  }
  $total = $allFiles.Count
  $start = [datetime]::UtcNow
  $done = 0
  Write-Log "DeepCleanup found $total files."

  # show progress every 200 files or 3 sec
  $lastTick = [datetime]::UtcNow
  foreach ($f in $allFiles) {
    try { Remove-Item -LiteralPath $f.FullName -Force -ErrorAction SilentlyContinue } catch {}
    $done++
    $now = [datetime]::UtcNow
    if ($done -eq $total -or $done % 200 -eq 0 -or ($now - $lastTick).TotalSeconds -ge 3) {
      $elapsed = ($now - $start).TotalSeconds
      $est = ETA $done $total $elapsed
      $pctWithin = if ($total -gt 0) { 100.0 * $done / $total } else { 100.0 }
      $pctOverall = PercentForStep $idx $pctWithin
      Save-Status 'DeepCleanup' $idx $pctOverall "Deleting temp/cache ($done of $total)" $done $total $est.rate $est.eta
      $lastTick = $now
    }
  }

  # Windows Update cache (service-guarded) with progress
  Save-Status 'DeepCleanup' $idx (PercentForStep $idx 98) "Stopping Windows Update service..."
  try { Stop-Service -Name wuauserv -Force -ErrorAction SilentlyContinue } catch {}
  Start-Sleep 2

  $wuPath = "$env:WINDIR\SoftwareDistribution\Download"
  if (Test-Path $wuPath) {
    $wuFiles = Get-ChildItem -LiteralPath $wuPath -Recurse -Force -File -ErrorAction SilentlyContinue
    $wuTotal = $wuFiles.Count; $wuDone = 0
    Write-Log "Purging SoftwareDistribution\Download ($wuTotal files)..."
    $start2 = [datetime]::UtcNow
    $lastTick = [datetime]::UtcNow
    foreach ($wf in $wuFiles) {
      try { Remove-Item -LiteralPath $wf.FullName -Force -ErrorAction SilentlyContinue } catch {}
      $wuDone++
      $now = [datetime]::UtcNow
      if ($wuDone -eq $wuTotal -or $wuDone % 200 -eq 0 -or ($now - $lastTick).TotalSeconds -ge 3) {
        $elapsed2 = ($now - $start2).TotalSeconds
        $est2 = ETA $wuDone $wuTotal $elapsed2
        $pctWithin = if ($wuTotal -gt 0) { 100.0 * $wuDone / $wuTotal } else { 100.0 }
        $pctOverall = PercentForStep $idx (98 + 2*$pctWithin/100.0)   # last ~2% for WU purge
        Save-Status 'DeepCleanup' $idx $pctOverall "Purging Windows Update cache ($wuDone of $wuTotal)" $wuDone $wuTotal $est2.rate $est2.eta
        $lastTick = $now
      }
    }
  }

  try { Start-Service -Name wuauserv -ErrorAction SilentlyContinue } catch {}
  Save-Status 'DeepCleanup' $idx (PercentForStep $idx 100) "DeepCleanup completed"
}

# ----------- Step 2: DISM with live % from output/log -----------
function Run-Dism([int]$idx) {
  $dismLog = "$env:WINDIR\Logs\DISM\dism.log"
  if (Test-Path $dismLog) { Remove-Item $dismLog -Force -ErrorAction SilentlyContinue }

  Write-Log "Running DISM /RestoreHealth"
  $psi = New-Object System.Diagnostics.ProcessStartInfo
  $psi.FileName = "dism.exe"
  $psi.Arguments = "/Online /Cleanup-Image /RestoreHealth"
  $psi.RedirectStandardOutput = $true
  $psi.UseShellExecute = $false
  $psi.CreateNoWindow = $true
  $p = [System.Diagnostics.Process]::Start($psi)

  $start = [datetime]::UtcNow
  while (-not $p.HasExited) {
    $line = $p.StandardOutput.ReadLine()
    if ($null -ne $line) {
      # DISM prints progress like: "    40.0% ..."
      if ($line -match '([0-9]+(\.[0-9]+)?)%') {
        $pctWithin = [double]$matches[1]
        $elapsed = ([datetime]::UtcNow - $start).TotalSeconds
        $eta = if ($pctWithin -gt 0) { $elapsed * (100.0-$pctWithin) / $pctWithin } else { $null }
        $overall = PercentForStep $idx $pctWithin
        Save-Status 'DismRestoreHealth' $idx $overall ("DISM " + "{0:N1}% complete" -f $pctWithin) $null $null $null $eta
      }
      $line | Tee-Object -FilePath $LogFile -Append | Out-Null
    } else {
      Start-Sleep -Milliseconds 200
    }
  }
  if ($p.ExitCode -ne 0) { Write-Log "DISM exit code $($p.ExitCode)"; throw "DISM failed" }
  Save-Status 'DismRestoreHealth' $idx (PercentForStep $idx 100) "DISM completed"
}

# ----------- Step 3: SFC with live % from CBS log -----------
function Run-Sfc([int]$idx) {
  $cbsLog = "$env:WINDIR\Logs\CBS\CBS.log"
  if (Test-Path $cbsLog) { Remove-Item $cbsLog -Force -ErrorAction SilentlyContinue }

  Write-Log "Running SFC /SCANNOW"
  $proc = Start-Process -FilePath sfc.exe -ArgumentList "/SCANNOW" -PassThru -NoNewWindow

  $start = [datetime]::UtcNow
  $lastPct = 0.0
  while (-not $proc.HasExited) {
    Start-Sleep 2
    if (Test-Path $cbsLog) {
      # lines look like: "SR] Verifying 34% complete"
      $tail = Get-Content $cbsLog -Tail 10 -ErrorAction SilentlyContinue
      $pct = $null
      foreach ($l in $tail) {
        if ($l -match 'SR\].*?([0-9]{1,3})%') { $pct = [double]$matches[1] }
      }
      if ($pct -ne $null -and $pct -ne $lastPct) {
        $elapsed = ([datetime]::UtcNow - $start).TotalSeconds
        $eta = if ($pct -gt 0) { $elapsed * (100.0-$pct) / $pct } else { $null }
        $overall = PercentForStep $idx $pct
        Save-Status 'SfcScan' $idx $overall ("SFC " + "{0:N0}% complete" -f $pct) $null $null $null $eta
        $lastPct = $pct
      }
    }
  }
  if ($proc.ExitCode -ne 0) { Write-Log "SFC exit code $($proc.ExitCode)"; throw "SFC failed" }
  Save-Status 'SfcScan' $idx (PercentForStep $idx 100) "SFC completed"
}

# ---------------- Driver ----------------
$idx = 0
foreach ($step in $steps) {
  $idx++
  if ($step -in $completed) { Write-Log "Skipping $step (already complete)"; continue }
  try {
    switch ($step) {
      'DeepCleanup'      { Run-DeepCleanup      $idx }
      'DismRestoreHealth'{ Run-Dism             $idx }
      'SfcScan'          { Run-Sfc              $idx }
    }
    $completed += $step; Save-Checkpoint
  } catch {
    Write-Log "ERROR in $step: $_"
    Save-Status $step $idx (PercentForStep $idx 0) "ERROR: $($_.ToString())"
    throw
  }
}
Save-Status 'Completed' $idx 100 'All selected steps completed'
Write-Log "All done. Elapsed: $([int]$sw.Elapsed.TotalMinutes) minutes."
exit 0
